import React from "react";
import {UserItem} from './Follow'

const Profile= function(props){
let myDetails={props}
let userList={props}

userList=[{
  username:'a.lover',
  name:'akshay neje'

},
{
  username:'onkar',
  name:'onkar kadam'
},
{
  username:'praju',
  name:'prajakta mali'

}]
myDetails={
  username:'me',
  tweets:0,
  follower:0,
  following:0

}
  return(
    <div className=" ml-16 w-1/2">
      <div className="flex   border  border-gray-200 p-4 p-8 rounded-md shadow-sm">
        <div id="profile" className=" flex ml-4 w-1/3 items-center">
          <img src={myDetails.avatarUrl} alt={myDetails.username} className="h-12 w-16 rounded-full object-cover mr-8"/>
        </div>
        <div className="flex justify-stretch space-around ">
          <div id="my-tweets" className="flex-grow-1 flex-col items-start">
            <p className="text-center">{myDetails.tweets}</p>
            <p className="text-center">Tweets</p>
          </div>
          <div id="follower" className="flex-grow-1 flex-col items-center">
            <p className="text-center">{myDetails.follower}</p>
            <p className="text-center">Followers</p>
          </div>
          <div id="following" className="flex-grow-1 flex-col items-center">
            <p className="text-center">{myDetails.following}</p>
            <p className="text-center">Following</p>
          </div>  
        </div>
      </div>
      <div id="list">
        {
          userList.map(element => (
            <UserItem key={element.id} userDetails={element} />
          ))
        }
      </div>
    </div>
  )
}

export {Profile}
